import { Routes, Route } from "react-router-dom";

import Header from "./Header";
import Home from "./Home";

function App() {
    return (
        <div>
            <Header />

            <Routes>
                <Route path="/" element={<Home />}/>
                <Route path="/" />
                <Route path="/" />
            </Routes>
        </div>
    )
};

export default App;
